import React from "react";

function Search(porps) {
  return (
    <div className="form">
      <span className="container">
        <input
          type="text"
          onChange={porps.Change}
          value={porps.iText}
          placeholder="Type to search for products"
        />
      </span>
      <button onClick={porps.aText}>
        <span>Search</span>
      </button>
    </div>
  );
}

export default Search;
